import './App.css';
import Greetings from "./Greetings.js"
import React from "react";

class SimpleForm extends React.Component {
  render() {
    return (
      <div>
        <input type="text" name="firstName" />
        <Greetings firstName="John" />
      </div>
    );
  }
}

function App() {
  return (
    <div>
      <SimpleForm />
    </div>
  );
}

export default App;
